<?php declare(strict_types=1);

namespace helena\tests\classes;

use minga\framework\IO;
use helena\classes\Image;
use helena\classes\TestCase;

use minga\framework\ErrorException;

class ImageTest extends TestCase
{
	private function createImage()
	{
		$img = "";
		$tmp = IO::GetTempFilename() . ".png";
		IO::WriteAllText($tmp, base64_decode($img));
		return $tmp;
	}

	public function testGetImageSize()
	{
		$tmp = $this->createImage();
		$size = Image::GetImageSize($tmp);

		$this->assertEquals(3084, $size['width']);
		$this->assertEquals(1139, $size['height']);

		unlink($tmp);
	}

	public function testResizeImage()
	{
		$tmp = $this->createImage();
		Image::ResizeToMaxSize($tmp, null, 200);
		$size = Image::GetImageSize($tmp);

		$this->assertEquals(541, $size['width']);
		$this->assertEquals(200, $size['height']);

		unlink($tmp);
	}

}

